    geo_json_14a4a5d618ab50a2d5b0815a0377321f.bindTooltip(
      function (layer) {
        let div = L.DomUtil.create("div");

        let handleObject = (feature) =>
          typeof feature == "object" ? JSON.stringify(feature) : feature;
        let fields = ["id", "branch_type", "bus1_id", "bus2_id"];
        let aliases = ["Id:", "Type:", "Bus1:", "Bus2:"];
        let table =
          "<table>" +
          String(
            fields
              .map(
                (v, i) =>
                  `<tr>
            <th>${aliases[i].toLocaleString()}</th>

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`,
              )
              .join(""),
          ) +
          "</table>";
        div.innerHTML = table;

        return div;
      },
      { className: "foliumtooltip", maxWidth: 800, sticky: false },
    );
